import { Routes } from "react-router-dom";
import Footer from "./Components/Footer";
import Navbar from "./Components/Navbar";
import Home from './Routes'


function App() {
  return (
    <Routes>
      <div className="App">
          <Navbar/>
          <Footer/>
      </div>
      <Route path='/' element={<Home/>}/>
    </Routes>
  );
}

export default App;
